-- ----------------------------
-- View structure for item_released
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[item_released]') AND type IN ('V'))
	DROP VIEW [dbo].[item_released]
GO

CREATE VIEW [dbo].[item_released] AS SELECT TRANSNO,ITEMNO,SUM(QTY) AS QTY,SUM(TOTALRELEASED) AS TOTALRELEASED ,SUM(QTY)-SUM(TOTALRELEASED) AS REMAINING FROM
(SELECT
dbo.tblSalesOrder.salesOrderNo as TRANSNO,
dbo.tblSalesItemsTR.itemNo,
dbo.tblSalesItemsTR.qty,
0 as totalReleased
FROM
dbo.tblSalesOrder
INNER JOIN dbo.tblSalesItemsTR ON dbo.tblSalesOrder.salesOrderNo = dbo.tblSalesItemsTR.transNo
union all
select 
refno,
itemno,
0 as qty,
qty as totalReleased
from
(SELECT
dbo.[Sales Invoice].refNo,
dbo.tblSalesItemsTR.itemNo,
sum(dbo.tblSalesItemsTR.qty) as qty

FROM
dbo.[Sales Invoice]
INNER JOIN dbo.tblSalesDeliver ON dbo.tblSalesDeliver.refNo = dbo.[Sales Invoice].[No]
INNER JOIN dbo.tblSalesItemsTR ON dbo.tblSalesDeliver.salesDeliverNo = dbo.tblSalesItemsTR.transNo
group by
dbo.[Sales Invoice].refNo,
dbo.tblSalesItemsTR.itemNo) as st
) as subt 
GROUP BY
TRANSNO,ITEMNO
GO


