-- ----------------------------
-- View structure for LEDGER_VIEW
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[LEDGER_VIEW]') AND type IN ('V'))
	DROP VIEW [dbo].[LEDGER_VIEW]
GO

CREATE VIEW [dbo].[LEDGER_VIEW] AS SELECT
dbo.tblCOA.accNo,
dbo.tblCOA.accountName,
a.refNo,
a.src,
a.dateTrans,
a.memo,
case when a.accno like '1%' or  a.accno like '5%' or a.accno like '6%' then
(select ISNULL((select sum (d.debit) - sum(d.credit) from tblAccEntry d where d.accno = a.accno ), 0))
when a.accno like '2%' or  a.accno like '3%' or a.accno like '4%' then
(select ISNULL((select - + sum (d.debit) + sum(d.credit) from tblAccEntry d where d.accno = a.accno ), 0))
end
as BEGINNING_BALANCE,
ISNULL(a.debit,0) as debit,
ISNULL(a.credit,0) as credit,
case when a.accno like '1%' or  a.accno like '5%' or a.accno like '6%' then
(select  sum(b.debit) - sum(b.credit) from dbo.tblAccEntry b where b.entryID <= a.entryID and b.accno = a.accno)
when a.accno like '2%' or  a.accno like '3%' or a.accno like '4%' then
(select  sum(b.credit) - sum(b.debit) from dbo.tblAccEntry b where b.entryID <= a.entryID and b.accno = a.accno) 
end
as ENDING_BALANCE
FROM
dbo.tblAccEntry a
RIGHT JOIN dbo.tblCOA ON a.accNo = dbo.tblCOA.accNo
GO


-- ----------------------------
-- View structure for paymentsView
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[paymentsView]') AND type IN ('V'))
	DROP VIEW [dbo].[paymentsView]
GO

CREATE VIEW [dbo].[paymentsView] AS SELECT CARDID,
CARDNAME,
INVOICENO,
CASE WHEN sum(TOTALAMOUNT)- sum(AMOUNTPAID) <= 0 then 'CLOSE' ELSE 'OPEN' END AS STATUS,
[DATE],
SUM(TOTALAMOUNT) AS TOTALAMOUNT,
SUM(TOTALDISCOUNT) AS TOTALDISCOUNT,
SUM(AMOUNTPAID) AS AMOUNTPAID
FROM(
SELECT
dbo.tblCardsProfile.cardID as CARDID,
dbo.tblCardsProfile.cardName AS CARDNAME,
dbo.tblsalesChargeInvoice.salesChargeInvoiceNo AS INVOICENO,
convert(varchar, dbo.tblsalesChargeInvoice.transDate, 101) AS [DATE],
dbo.tblsalesChargeInvoice.totalDiscount as TOTALDISCOUNT,
dbo.tblsalesChargeInvoice.totalAmount AS TOTALAMOUNT,
0 AMOUNTPAID
FROM
dbo.tblCardsProfile
INNER JOIN dbo.tblsalesChargeInvoice ON dbo.tblCardsProfile.cardID = dbo.tblsalesChargeInvoice.cardID
GROUP BY
dbo.tblCardsProfile.cardID,
dbo.tblCardsProfile.cardName,
dbo.tblsalesChargeInvoice.salesChargeInvoiceNo,
dbo.tblsalesChargeInvoice.transDate,
dbo.tblsalesChargeInvoice.totalDiscount,
dbo.tblsalesChargeInvoice.totalAmount
UNION ALL
SELECT
dbo.tblCardsProfile.cardID as CARDID,
dbo.tblCardsProfile.cardName AS CARDNAME,
dbo.tblsalesChargeInvoice.salesChargeInvoiceNo AS INVOICENO,
convert(varchar, dbo.tblsalesChargeInvoice.transDate, 101) AS [DATE],
0 AS TOTALDISCOUNT,
0 AS TOTALAMOUNT,
Sum(dbo.tblPaymentsReceived.amountApplied) AS AMOUNTPAID
FROM
dbo.tblCardsProfile
INNER JOIN dbo.tblsalesChargeInvoice ON dbo.tblCardsProfile.cardID = dbo.tblsalesChargeInvoice.cardID
INNER JOIN dbo.tblPaymentsReceived ON dbo.tblsalesChargeInvoice.salesChargeInvoiceNo = dbo.tblPaymentsReceived.invoiceNo
GROUP BY
dbo.tblCardsProfile.cardID,
dbo.tblCardsProfile.cardName,
dbo.tblsalesChargeInvoice.salesChargeInvoiceNo,
dbo.tblsalesChargeInvoice.transDate,
dbo.tblsalesChargeInvoice.totalAmount
) AS SUBT
GROUP BY
CARDID,CARDNAME,INVOICENO,[DATE]
GO


