CREATE PROCEDURE [dbo].[insert_invAccount_entry]
@itemNo varchar(255),
@entryMode varchar(255),

@refNo varchar(255),
@src varchar(255),
@memo varchar(255),
@debit decimal(20,2),
@credit decimal(20,2)
AS
declare 
@accCost varchar(255),
@accIncome varchar(255),
@accAsset varchar(255)

select @accCost = COSTOFSALESACC,
@accIncome = INCOMEACC,
@accAsset = ASSETACC
from tblInvtry 
where
itemno = @itemno

IF @entryMode = 'COSTACC'
INSERT INTO tblAccEntry values(@refNo,@src,@accCost,@memo,@debit,@credit)
else if  @entryMode = 'INCOMEACC'
INSERT INTO tblAccEntry values(@refNo,@src,@accIncome,@memo,@debit,@credit)
else if  @entryMode = 'ASSETACC'
INSERT INTO tblAccEntry values(@refNo,@src,@accAsset,@memo,@debit,@credit)
GO


